import CommonSection from "../components/UI/common-section/CommonSection";
import {Col, Container, Row} from "reactstrap";

import '../styles/cart-pages.css'

const Cart = () => {
    return (
        <>
            <CommonSection title="Корзина"/>
            <section>
                <Container>
                    <Row>
                        <Col lg="12">
                            <table className="table table-bordered d-flex">
                                <thead>
                                     <Tr/>
                                </thead>
                                <tbody>

                                </tbody>
                            </table>
                        </Col>
                    </Row>
                </Container>
            </section>
        </>
    );
}


const Tr = props => {
    return (
        <tr>
            <td>Фото</td>
            <td>Название продукта</td>
            <td>Стоимость</td>
            <td>Количетсво</td>
            <td>Удалить</td>
        </tr>
    );
}

export default Cart;
